import React from 'react';

import mapMarker from "../images/map-marker.svg";

function OrphanagesMap() {
    return (
        <div id="page-map">
            <aside>
                <header>
                    <img src={mapMarker} alt="Happy" />
                </header>
            </aside>
        </div>
    );
}

export default OrphanagesMap;
